// src/workers/stockfish.worker.js
// Load stockfish.js from your public folder. 
// (When using a development server, files in "public" are served at the root URL.)
importScripts('/stockfish/stockfish.js');

// The global STOCKFISH variable is defined by stockfish.js.
const engine = STOCKFISH();

engine.onmessage = function(event) {
  // Relay Stockfish's output back to the main thread.
  postMessage(event.data);
};

onmessage = function(event) {
  // Forward any message from the main thread to Stockfish.
  engine.postMessage(event.data);
};
